import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import axios from 'axios';
import { useRecordWebcam } from 'react-record-webcam';
import { BsDownload } from "react-icons/bs";
import cameof from "../Images/cameof.jpg";

const Interview = () => {
  const { subject } = useParams();
  const [questions, setQuestions] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [currentQuestionIndex, setCurrentQuestionIndex] = useState(0);
  const recordWebcam = useRecordWebcam({ frameRate: 60 });

  useEffect(() => {
    const fetchQuestions = async () => {
      try {
        const response = await axios.post(
          'https://asia-south1-language.googleapis.com/v1/models/text-bison-001:generateText', 
          {
            prompt: `Generate Interview questions for ${subject}`,
            maxOutputTokens: 150,
            temperature: 0.9,  
            candidateCount: 10 
          },
          {
            headers: {
              'Content-Type': 'application/json',
              'Authorization': 'YOUR_API_KEY_HERE', 
            },
          }
        );

        const aiQuestions = response.data.candidates.map(candidate => candidate.output.trim());
        setQuestions(aiQuestions);
      } catch (err) {
        setError('Failed to load questions. Please try again later.');
      } finally {
        setLoading(false);
      }
    };

    fetchQuestions();
  }, [subject]);

  useEffect(() => {
    const initCameraAndRecord = async () => {
      await recordWebcam.open();
      await recordWebcam.start();
    };

    initCameraAndRecord();

    return () => {
      // Only close if open, and check if functions are defined
      if (recordWebcam?.close && recordWebcam.status === 'OPEN') {
        recordWebcam.close();
      }
    };
  }, [recordWebcam]);

  const saveFile = async () => {
    if (recordWebcam.getRecording) {
      const blob = await recordWebcam.getRecording();
      const url = URL.createObjectURL(blob);
      const a = document.createElement('a');
      a.href = url;
      a.download = 'recording.webm';
      document.body.appendChild(a);
      a.click();
      document.body.removeChild(a);
      URL.revokeObjectURL(url);
    }
  };

  const nextQuestion = () => {
    setCurrentQuestionIndex((prevIndex) => (prevIndex + 1) % questions.length);
  };

  return (
    <div style={{ display: 'flex', justifyContent: 'center', padding: '20px' }}>
      {/* Left Side: Video Preview */}
      <div style={{ width: '45%', display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
        <div className="mt-4 border-rose-700" style={{ width: '100%' }}>
          {recordWebcam.status === 'CLOSED' ? (
            <div>
              <img src={cameof} alt="Camera off" className="w-full max-w-md mx-auto" />
              <p>Camera is off. Please turn on the camera.</p>
            </div>
          ) : (
            <video 
              ref={recordWebcam.webcamRef} // Connect directly to recordWebcam's webcamRef
              autoPlay 
              muted 
              className="w-full max-w-md mx-auto" 
            />
          )}
        </div>

        <a onClick={saveFile} className="bg-purple-500 text-white px-4 py-2 rounded-md hover:bg-purple-600 cursor-pointer mt-4">
          <BsDownload /> Download Recording
        </a>
        
        <p className="text-center mt-2 text-white">Camera status: {recordWebcam.status}</p>
      </div>

      {/* Right Side: Interview Questions */}
      <div style={{ width: '45%', display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
        {loading ? (
          <p>Loading questions...</p>
        ) : error ? (
          <p className="text-red-500">{error}</p>
        ) : (
          <div className="text-center text-white mt-4">
            <h2>Current Question:</h2>
            <p>{questions[currentQuestionIndex]}</p>
            <button onClick={nextQuestion} className="bg-orange-500 text-white px-4 py-2 rounded-md hover:bg-orange-600 mt-4">
              Next Question
            </button>
          </div>
        )}
      </div>
    </div>
  );
};

export default Interview;
